import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click a product card to open the modal.
    // Using a locator that finds a specific product to be robust.
    const productCard = page.locator('div.product-card:has-text("Sony WH-1000XM5")');
    await productCard.waitFor({ state: 'visible', timeout: 5000 });
    await productCard.click();

    // 2. Wait for the modal to become visible.
    const modal = page.locator('#productModal');
    await modal.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot with the modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    const modalWasVisible = await modal.isVisible();

    // 3. Press the Escape key to close the modal.
    await page.keyboard.press('Escape');

    // 4. Wait for the modal to be hidden.
    await modal.waitFor({ state: 'hidden', timeout: 5000 });

    // Take a final screenshot to confirm the modal is closed.
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    const modalIsHidden = await modal.isHidden();

    if (!modalWasVisible || !modalIsHidden) {
      throw new Error('Modal visibility state change was not correctly verified.');
    }

    return {
      success: true,
      action: "Opened a product modal, closed it with the Escape key, and verified it is hidden.",
      extractedData: {
        modalWasVisible: modalWasVisible,
        modalIsHiddenAfterEscape: modalIsHidden
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
